const varint = require('varint')

module.exports = parse_decompressed

function parse_decompressed (decompressed, unique_el) {
  try {
    const offset = Buffer.from(unique_el, 'binary').length
    const decoded = decompressed.slice(offset)
    return decoded
  } catch(err) {
    console.log('error in parse decompressed')
  }
}